import React from 'react'
import { useNavigate } from 'react-router-dom';
import { ButtonHTMLAttributes } from 'react';

const register = "register";
const login = "login";
const menu = "menu";

const navigate = useNavigate();

function NavigateToHome(){
    

    navigate("/");
}

function NavigateToLink(denumire){
    const navigate = useNavigate();

    navigate("/" + denumire);
}

function Navbar2() {
    return (
        <div className='navbar'>
            <div className='containerNavbarButtons'>
                <button className="navbarButtons" id="menuAbout" onClick={() => {NavigateToHome()}}>About</button>
                <button className="navbarButtons" id="menuRegister" onClick={() => {NavigateToLink(register)}}>Register</button>
                <button className="navbarButtons" id="loginMenu">Login</button>
                <button className="navbarButtons" id="menu">Menu</button>
            </div>
        </div>
    )
}

export default Navbar2;
